import axios from "axios"
import { useState } from "react"

export default function Book(props) {
  const [book,setBook] = useState([])
  axios.get(`https://api.artic.edu/api/v1/artworks/${props.id}`)
  .then((res)=>{
    setBook(res.data.data)
  })
  return (
    <div>
      <h3>{book.title}</h3>
    </div>
  )
}
